const User = () => {
    const userHead = () => {
        return (
            <React.Fragment>
                <h1>User Page</h1>
                <br />
            </React.Fragment>
        ) 
    }
    return (
        <Layout>
            
            <div className="col-md-6 offset-md-3">
                {userHead()} 
                <hr/>
            </div> 
        </Layout>
    )
}

export default User;
